    <Box pos={"absolute"} w={"100%"} bg={"#00000014"} padding={"12px"}>
      <Wrap>
        <WrapItem>
          <Center bg="gray.200" fontWeight={"bold"} rounded={"50px"}>
            bberkass
          </Center>
        </WrapItem>
      </Wrap>
    </Box>
  );
};
